import { useEffect, useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import { jsPDF } from "jspdf";
import "jspdf-autotable";
import { FiArrowLeft, FiPrinter, FiXCircle, FiCheckCircle, FiClock, FiDollarSign } from "react-icons/fi";
import "./AdminOrdenes.css";

function AdminOrdenes() {
  const [ordenes, setOrdenes] = useState([]);
  const [filtro, setFiltro] = useState("fecha"); // 'fecha' o 'precio'
  const navigate = useNavigate();

  useEffect(() => {
    cargarOrdenes();
  }, []);

  const cargarOrdenes = async () => {
    try {
      const res = await axios.get("http://localhost:4000/api/ordenes");
      setOrdenes(res.data);
    } catch (error) {
      console.error("Error cargando órdenes:", error);
    }
  };

  // ---------------------------------------------
  // ACCIONES
  // ---------------------------------------------
  const handleCancelar = async (id) => {
    if (!window.confirm("¿Seguro que deseas CANCELAR esta orden? Se devolverán los productos al stock.")) return;

    try {
      await axios.put(`http://localhost:4000/api/ordenes/${id}/cancelar`);
      alert("✅ Orden cancelada. Stock restaurado.");
      cargarOrdenes();
    } catch (error) {
      alert("Error al cancelar orden");
    }
  };

  const handleFinalizar = async (id) => {
    try {
      await axios.put(`http://localhost:4000/api/ordenes/${id}/finalizar`);
      cargarOrdenes();
    } catch (error) {
      alert("Error al finalizar orden");
    }
  };

  // ---------------------------------------------
  // GENERAR PDF (Función Integrada)
  // ---------------------------------------------
  const generarTicketPDF = (orden, ancho = 80) => {
    // 1. Extraemos los datos de la orden específica
    const mesaId = orden.mesaId;
    const nombreMesero = orden.mesero;
    const carrito = orden.productos;
    const total = orden.total;
    // Usamos la fecha de la orden, si no existe usa la actual
    const fechaOrden = orden.fecha || orden.createdAt || new Date(); 

    const doc = new jsPDF({
      unit: "mm",
      format: [ancho, 300] // Largo dinámico
    });

    // --------------------------------------------------------------------
    // LOGO: PEGA AQUÍ TU STRING BASE64 LARGO
    // --------------------------------------------------------------------
    const logoBase64 = "data:image/png;base64,";
    
    // Dimensiones del logo
    const imgWidth = 20; 
    const imgHeight = 20; 
    const xLogo = (ancho - imgWidth) / 2; // Centrado horizontalmente

    // Agregar imagen
    try {
        if(logoBase64) doc.addImage(logoBase64, 'PNG', xLogo, 5, imgWidth, imgHeight);
    } catch (error) {
        console.log("Error cargando logo", error);
    }

    let yPos = 30;

    // ----- ENCABEZADO -----
    doc.setFontSize(14);
    doc.text("BARBACOA ARI", ancho / 2, yPos, { align: "center" });

    doc.setFontSize(10);
    // Ajustamos yPos para que no se encimen los textos
    yPos += 8;
    doc.text(`Mesa: ${mesaId}`, 5, yPos);
    
    yPos += 6;
    doc.text(`Mesero: ${nombreMesero || "No especificado"}`, 5, yPos);
    
    yPos += 6;
    doc.text(`Fecha: ${new Date(fechaOrden).toLocaleString()}`, 5, yPos);
    
    yPos += 8; // Espacio antes de la dirección

    // Dirección
    doc.setFontSize(9); // Un poco más pequeño para que quepa bien
    doc.text("Estamos ubicados:", 5, yPos); yPos += 4;
    doc.text("Viernes y Sábados:", 5, yPos); yPos += 4;
    doc.text("Blvrd Ramón G. Bonfil & Av. 2", 5, yPos); yPos += 4;
    doc.text("Domingos:", 5, yPos); yPos += 4;
    doc.text("Av. Cerezo Col. Luz Del Carmen", 5, yPos); yPos += 4;
    doc.text("(Tianquis)", 5, yPos);
    
    yPos += 5;
    doc.line(3, yPos, ancho - 3, yPos);
    
    // TABLA
    // Usamos yPos actual + un margen para iniciar la tabla
    const startYTable = yPos + 4; 

    const filas = carrito.map(item => [
      `${item.nombre} x${item.cantidad}`,
      `$${(item.precio * item.cantidad).toFixed(2)}`
    ]);

    doc.autoTable({
      startY: startYTable,
      head: [["Producto", "Total"]],
      body: filas,
      theme: "striped",
      styles: { fontSize: 9, cellPadding: 1 },
      tableWidth: ancho - 6,
      margin: { left: 3 }
    });

    let finalY = doc.lastAutoTable.finalY + 6;

    // Total
    doc.setFontSize(12);
    doc.text(`Total: $${total.toFixed(2)}`, 5, finalY);

    // Mensaje final
    doc.setFontSize(10);
    doc.text("¡Gracias por su visita!", 5, finalY + 10);
    
    // Si está cancelada, ponemos una marca de agua o texto
    if(orden.estado === 'Cancelada'){
        doc.setTextColor(255,0,0);
        doc.setFontSize(16);
        doc.text("CANCELADA", ancho/2, finalY + 20, { align: "center" });
    }

    // Descargar PDF
    doc.save(`ticket_mesa_${mesaId}.pdf`);
  };

  // ---------------------------------------------
  // CÁLCULOS Y ORDENAMIENTO
  // ---------------------------------------------
  const ordenesFiltradas = [...ordenes].sort((a, b) => {
    if (filtro === "precio") return b.total - a.total; 
    // Por fecha (mas reciente primero)
    return new Date(b.fecha || b.createdAt) - new Date(a.fecha || a.createdAt);
  });

  const ventasTotales = ordenes
    .filter(o => o.estado === "Finalizada")
    .reduce((acc, o) => acc + o.total, 0);

  return (
    <div className="admin-ordenes-container">
      
      {/* HEADER */}
      <div className="ordenes-header">
        <button className="btn-volver" onClick={() => navigate("/admin")}>
          <FiArrowLeft /> Regresar
        </button>
        
        <div className="titulo-seccion">
          <h1>Gestión de Órdenes</h1>
          <span className="badge-ventas">Ventas Finalizadas: ${ventasTotales.toFixed(2)}</span>
        </div>

        <div className="filtros">
          <label>Ordenar por:</label>
          <button 
            className={filtro === 'fecha' ? 'activo' : ''} 
            onClick={() => setFiltro('fecha')}
          >
            <FiClock /> Fecha
          </button>
          <button 
            className={filtro === 'precio' ? 'activo' : ''} 
            onClick={() => setFiltro('precio')}
          >
            <FiDollarSign /> Total
          </button>
        </div>
      </div>

      {/* LISTA DE TARJETAS */}
      <div className="grid-ordenes">
        {ordenesFiltradas.length === 0 ? (
          <div className="no-ordenes">No hay órdenes registradas hoy.</div>
        ) : (
          ordenesFiltradas.map((orden) => (
            <div key={orden._id} className={`orden-card estado-${orden.estado || 'Pendiente'}`}>
              
              <div className="card-header">
                <h3>Mesa {orden.mesaId}</h3>
                <span className={`estado-badge ${orden.estado || 'Pendiente'}`}>
                  {orden.estado || "Pendiente"}
                </span>
              </div>

              <div className="card-body">
                <p><strong>Mesero:</strong> {orden.mesero}</p>
                <p><strong>Hora:</strong> {new Date(orden.fecha || orden.createdAt).toLocaleTimeString()}</p>
                
                <div className="lista-items">
                  {orden.productos.map((p, i) => (
                    <div key={i} className="item-row">
                      <span>{p.cantidad} x {p.nombre}</span>
                    </div>
                  ))}
                </div>

                <div className="card-total">
                  Total: ${orden.total.toFixed(2)}
                </div>
              </div>

              <div className="card-actions">
                {/* Botón Imprimir -> Llama a tu función */}
                <button 
                  className="btn-icon print" 
                  onClick={() => generarTicketPDF(orden)} 
                  title="Reimprimir Ticket"
                >
                  <FiPrinter />
                </button>

                {/* Acciones solo si está Pendiente */}
                {(!orden.estado || orden.estado === "Pendiente") && (
                  <>
                    <button 
                      className="btn-action cancelar" 
                      onClick={() => handleCancelar(orden._id)}
                    >
                      <FiXCircle /> Cancelar
                    </button>
                    
                    <button 
                      className="btn-action finalizar" 
                      onClick={() => handleFinalizar(orden._id)}
                    >
                      <FiCheckCircle /> Finalizar
                    </button>
                  </>
                )}
              </div>
            </div>
          ))
        )}
      </div>
    </div>
  );
}

export default AdminOrdenes;